import React from 'react';
import { Link } from 'react-router-dom';

const UserHome = () => {
  return (
    <div className="bg-white p-8 rounded-lg shadow-lg max-w-md mx-auto mt-10">
      <h2 className="text-2xl font-semibold text-center text-yellow-600 mb-5">Welcome to Your Dashboard</h2>
      <p className="text-center text-gray-600 mb-4">Here are your options:</p>
      <div className="space-y-4">
        <Link to="/make-payment" className="block w-full p-3 bg-yellow-500 text-black rounded text-center hover:bg-yellow-600 transition duration-300">
          Make a Payment
        </Link>
        <Link to="/payment-history" className="block w-full p-3 bg-yellow-500 text-black rounded text-center hover:bg-yellow-600 transition duration-300">
          View Payment History
        </Link>
      </div>
    </div>
  );
};

export default UserHome;
